import Labels from '../Labels.json'








const Quotes = () => {
    const [index ,setindex]= useState(NumberRandom)

    const ChangesQuotes = () => {
        let NumberRandom =Math.floor(Math.random()*Labels.length)
  
        setindex(NumberRandom)
    
    
    
    }
    

    return (
        <div>
          <h1>{Labels[NumberRandom].quote}</h1>  
            <h1>{Labels[NumberRandom].author}</h1>

         <button onClick={ChangesQuotes}> <i class="fa-solid fa-circle-play"></i> </button>

        </div>
    );
};

export default Quotes;
